prompt --application/shared_components/plugins/dynamic_action/apex_sweet_alert
begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(102603925816012999183)
,p_plugin_type=>'DYNAMIC ACTION'
,p_name=>'APEX.SWEET.ALERT'
,p_display_name=>'APEX SweetAlert Confirm'
,p_category=>'NOTIFICATION'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_RENDER (',
'    P_DYNAMIC_ACTION   IN APEX_PLUGIN.T_DYNAMIC_ACTION,',
'    P_PLUGIN           IN APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT AS',
'    VR_RESULT          APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT;',
'    VR_REQUIRE_ESCAPE  BOOLEAN := TRUE;',
'    VR_CONFIG_JSON     P_DYNAMIC_ACTION.ATTRIBUTE_01%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_01;',
'    VR_COMPARE_TYPE    P_DYNAMIC_ACTION.ATTRIBUTE_06%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_06;',
'    VR_REQUIRED_VALUE  VARCHAR2(32767) := NULL;',
'    VR_REQUIRED_ITEM   P_DYNAMIC_ACTION.ATTRIBUTE_02%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_02;',
'    VR_CONF_JSON_ITEM  P_DYNAMIC_ACTION.ATTRIBUTE_02%TYPE := P_DYNAMIC_ACTION.ATTRIBUTE_05;',
'BEGIN',
'',
'    APEX_CSS.ADD_FILE(',
'        P_NAME        => ''sweetalert.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''sweetalertcsssrc''',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''sweetalert.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''sweetalertjssrc''',
'    );',
'    ',
'    CASE VR_COMPARE_TYPE',
'        WHEN ''item'' THEN',
'            VR_REQUIRED_VALUE := V(P_DYNAMIC_ACTION.ATTRIBUTE_02);',
'        WHEN ''static'' THEN',
'            VR_REQUIRED_VALUE := P_DYNAMIC_ACTION.ATTRIBUTE_07;',
'        ELSE',
'            VR_REQUIRED_VALUE := DBMS_RANDOM.STRING(''L'',6);',
'    END CASE;',
'    ',
'    IF',
'        P_DYNAMIC_ACTION.ATTRIBUTE_03 = ''N''',
'    THEN',
'        VR_REQUIRE_ESCAPE   := FALSE;',
'    ELSE',
'        VR_REQUIRE_ESCAPE   := TRUE;',
'    END IF;',
'    ',
'    IF',
'        P_DYNAMIC_ACTION.ATTRIBUTE_04 = ''ATTRIBUTES''',
'    THEN',
'        VR_CONF_JSON_ITEM   := NULL;',
'    END IF;',
'',
'    VR_RESULT.JAVASCRIPT_FUNCTION   := ''function () { sweetAlert.initialize(this,'' ||',
'        APEX_JAVASCRIPT.ADD_VALUE( VR_CONF_JSON_ITEM, TRUE ) ||',
'        APEX_JAVASCRIPT.ADD_VALUE( VR_CONFIG_JSON, TRUE ) ||',
'        APEX_JAVASCRIPT.ADD_VALUE( VR_REQUIRED_VALUE, TRUE ) ||',
'        APEX_JAVASCRIPT.ADD_VALUE( VR_REQUIRED_ITEM, TRUE ) ||',
'        APEX_JAVASCRIPT.ADD_VALUE( VR_REQUIRE_ESCAPE, FALSE ) ||',
'        '') }'';',
'',
'    RETURN VR_RESULT;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_standard_attributes=>'BUTTON:REGION:STOP_EXECUTION_ON_ERROR:WAIT_FOR_RESULT'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'That Dynamic Action Plug-in is intended to enable a security query in APEX. For example, before deleting a lot of data, the end user must first enter a comparison text before the page is submitted.'
,p_version_identifier=>'1.5.1'
,p_about_url=>'https://github.com/RonnyWeiss/Apex-SweetAlert-Confirm'
,p_files_version=>1391
);
wwv_flow_api.create_plugin_attribute(
 p_id=>wwv_flow_api.id(102603926067933999185)
,p_plugin_id=>wwv_flow_api.id(102603925816012999183)
,p_attribute_scope=>'COMPONENT'
